            ? 1000 / step * (board.IsWhiteToMove ? -1 : 1)
            : board.IsDraw() ? 0 
            : forward(board) * white);

    Move bestMove = new Move();
    double value = maximizingPlayer ? double.NegativeInfinity : double.PositiveInfinity;

    foreach (Move move in moves)
    {
        board.MakeMove(move);
        (_, double childValue) = AlphaBeta(board, depth - 1, alpha, beta, !maximizingPlayer, white, step + 1);
        board.UndoMove(move);

        if ((maximizingPlayer && childValue >= value) || (!maximizingPlayer && childValue <= value))
        {
            value = childValue;
            bestMove = move;
        }

        if (maximizingPlayer) alpha = Math.Max(alpha, value);
        else beta = Math.Min(beta, value);

        if (beta <= alpha) break;
    }

    return (bestMove, value);
}

